import React from 'react';
import './header.css';

function Header(){
    return(
        <div className="header">
            <div className="logo_arman">
                <a href={""}><img src="https://www.google.com/url?sa=i&source=images&cd=&ved=2ahUKEwjQ6LjsoIXnAhXl8KYKHetNDpEQjRx6BAgBEAQ&url=https%3A%2F%2Ficonproducts.com%2Fforbes-interviews-jorge-rubin%2Fforbes-logo%2F&psig=AOvVaw0vE25IMrAsCot5ljYq1QPK&ust=1579165711585510" alt=""/></a>
            </div>
            <div className="navbar">
                <a>Billionaires</a>
                <a>Innovation</a>
                <a>Leadership</a>
                <a>Money</a>
                <a>Business</a>
                <a>Small Business</a>
                <a>Lifestyle</a>
                <a>Lists</a>
                <a>Advisor</a>
                <a>Featured</a>
                <a>Breaking</a>
                <a>More</a>
            </div>
        </div>
    );
}

export default Header;
